import "./App.css";
import "./index.css";
import React from "react";
import { Route, Routes } from "react-router-dom";
import { Header } from "./Components/Header";
import Login from "./Components/Login";
import { Menu } from "./Components/Menu"; // Importaci贸n de la exportaci贸n nombrada
import   { librosP }    from "./Components/librosP";
import  registrarL from "./Components/registrarL";
import   libroD from "./Components/libroD";
import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  return (
    <div className="App">
      <Header />
      <Routes>
        <Route path="/" element={<Login />} />
        <Route path="/menu" element={<Menu />} />
        <Route path="/librosP" element={<librosP /> } />
        <Route path="/registrarL" element={<registrarL /> } />
        <Route path="/libroD" element={< libroD />} />
      </Routes>
    </div>
  );
}

export default App;
